package com.sina.parkingManagement.model;import com.sina.parkingManagement.common.baseModel.BaseEntity;import lombok.Data;import javax.persistence.*;import java.util.Date;@Entity@Data@Table(name = ParkingDetails.PARKING_DETAIL_TBL)public class ParkingDetails extends BaseEntity {    public static final String PARKING_DETAIL_TBL = "parking_detail_tbl";    @Temporal(TemporalType.TIMESTAMP)    private Date timeIn;    @Temporal(TemporalType.TIMESTAMP)    private Date timeOut;    private Long totalPrice;    @ManyToOne()    @JoinColumn(name = "parking_id", referencedColumnName = "id")    private com.sina.parkingManagement.model.Parking parking;    @ManyToOne()    @JoinColumn(name = "vehicle_id", referencedColumnName = "id")    private Vehicle vehicle;    @ManyToOne()    @JoinColumn(name = "price_rate_id", referencedColumnName = "id")    private PriceRate priceRate;}